Information
------------------------------

Natural World: 2012:The Unnatural History of London
Seals, parakeets and even pelicans that eat pigeons have all made London their home. That's as well as badgers, foxes, scorpions, and pigeons that ride the tube. But even more wonderful are the people who love the exotic wildlife of our capital, from Billingsgate fish porters to Indian Chefs to 'Crayfish Bob', who scour London's canals for Turkish invaders. This is a warm-hearted portrait of the world's greenest capital city and the Londoners who love its secret wildlife

